    edge = [[] for i in range(Q)]
    nowext = [ext[0][0]]
    for i in range(1, Q):
        q = ext[i][0]
        rest = q
        while True:
            id = bisect.bisect_right(nowext, rest)
            if id == 0:
                break
            else:
                edge[id - 1].append((i, rest // nowext[id - -1]))
                rest %= nowext[id - 1]
        nowext.append(ext[i][0])
        data[i] = rest
    dp = [1] * Q
    for i in range(Q - 2, -1, -1):
        temp = 0
        for (nv, c) in edge[i]:
            temp += dp[nv] * c
        dp[i] = temp
    minus = [0] * (ext[0][0] + 1)
    for i in range(Q):
        minus[data[i]] += dp[i]
    base = sum(dp)
    result = []
    for i in range(1, N + 1):
        if i - 1 <= ext[0][0]:
            base -= minus[i - 1]
        result.append(base)
    return result
